import { StyleSheet } from "react-native";

import GlobalVars from "../../global/globalVars";

const Styles = StyleSheet.create({
  viewRoot: {
    flex: 1,
    paddingTop: 50,
    paddingBottom: 30,
    alignItems: "center",
    paddingHorizontal: 20,
    justifyContent: "center",
    backgroundColor: GlobalVars.white,
  },
});

export default Styles;
